import logo from './logo.svg';
import './App.css';
import {Route} from 'react-router-dom';
import Home from './pages/home/home.component';

const HatsPage=()=>(
  <div>
    <h1>
      Hats Page
    </h1>
  </div>
);
function App() {
  return (
    <div>
    <Route path='/' component={Home} />
    <Route path='/hats' component={HatsPage} />

    </div>
  );
}

export default App;
